import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Portfolio() {
  const [portfolio, setPortfolio] = useState([]);
  const [cart, setCart] = useState(() => {
    const savedCart = sessionStorage.getItem('cart');
    return savedCart ? JSON.parse(savedCart) : [];
  });
  const [userId, setUserId] = useState(null); // Initialize user ID as null

  useEffect(() => {
    fetchUserId(); // Fetch user ID when component mounts
  }, []);

  useEffect(() => {
    if (userId) {
      fetchUserProducts(); // Fetch user products when user ID is available
    }
  }, [userId]);

  const fetchUserId = async () => {
    try {
      // Logic to obtain the user ID from your authentication state
      const userId = 'user123'; // Replace with actual user ID retrieval logic
      setUserId(userId);
    } catch (error) {
      console.error("Error fetching user ID:", error);
    }
  };

  const fetchUserProducts = async () => {
    try {
      const response = await axios.post("http://localhost:8002/api/productList", {
        userId: userId // Pass the user ID to the backend
      });
      const userProducts = response.data.data;
      const activeProducts = userProducts.filter(product => !product.is_deleted && product.is_active);
      setPortfolio(activeProducts);
    } catch (error) {
      console.error("Error fetching user products:", error);
    }
  };

  const addToCart = (item) => {
    setCart(prevCart => {
      const updatedCart = [...prevCart, item];
      sessionStorage.setItem('cart', JSON.stringify(updatedCart));
      return updatedCart;
    });
    console.log("Item added to cart:", item);
  };

  useEffect(() => {
    localStorage.setItem("hardikCart", JSON.stringify(cart));
  }, [cart]);
  
  return (
    <>
      <div className="container section-title"></div>

      <section id="portfolio" className="portfolio section">
        <div className="container section-title">
          <h2>Products</h2>
          <p>Necessitatibus eius consequatur ex aliquid fuga eum quidem sint consectetur velit</p>
        </div>
        <div className="container">
          <div className="isotope-layout" data-default-filter="*" data-layout="masonry" data-sort="original-order">
            <ul className="portfolio-filters isotope-filters">
              <li data-filter="*" className="filter-active">All</li>
              <li data-filter=".filter-app">App</li>
              <li data-filter=".filter-product">Product</li>
              <li data-filter=".filter-branding">Branding</li>
            </ul>
            <div className="row gy-4 isotope-container">
              {portfolio.map((item, index) => (
                <div key={item.id || index} className={`col-lg-4 col-md-6 portfolio-item isotope-item filter-${item.category.toLowerCase()}`}>
                  <img src={item.url} className="img-fluid" alt={item.title} />
                  <div className="portfolio-info">
                    <h4>{item.title}</h4>
                    <p>{item.description}</p>
                    <p>${item.price}</p>
                    <p>{item.category}</p>
                    <a href={item.imageUrl} title={item.title} data-gallery={`portfolio-gallery-${item.category.toLowerCase()}`} className="glightbox preview-link"></a>
                    <button onClick={() => addToCart(item)} className="btn btn-primary">Add to Cart</button>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </section>
    </>
  );
}

export default Portfolio;
